import { Fragment,useEffect } from "react";
import Nav from './Nav';
import { Route,Routes } from 'react-router-dom';
import { connect } from 'react-redux';
import Page from './Page';
import Leaderboard from './Leaderboard';
import New from './New';
import {handleInitialData1} from '../actions/shared';
import Login from "./Login";
import authedUser from "../reducers/authedUser";
import NewQuestion from './NewQuestion';
import DoneQuestion from './DoneQuestion';
import { useNavigate } from "react-router-dom";
import Error from "./Error";
import { Navigate } from "react-router-dom";


const App = (props) => {
  useEffect(() => {
    const fetchData = async () => {
      await props.dispatch(handleInitialData1());
    };

    fetchData();
  });

    return (
      <Fragment>
        <div className="container">
          <Nav/>

              <Routes>

                <Route path="/" exact element={<Page/>}/>
                <Route path="/leaderboard"  element={<Leaderboard/>}/>
                <Route path="/new"  element={<New/>}/>
                <Route path="/newquestion/:id"  element={<NewQuestion/>}/>
                <Route path="/donequestion/:id"  element={<DoneQuestion/>}/>
                <Route path="/error"   element={<Error/>}/>



              </Routes>


        </div>
      </Fragment>
    )
  };
  const mapStateToProps=({authedUser})=>({

    authedUser,

  });

  export default connect(mapStateToProps)(App);
